import React from 'react'

class MainButtoms extends React.Component{
    render(){
        return(
            <div className = "group">
                <button id='btn1' onClick={this.gotocreate}>
                    <h1>Новый шаблон</h1>
                    <img src={this.props.image} alt="arrow" id = "butImg"></img>
                </button>
                <button id='btn1' onClick={this.gotoselect}>
                    <h1>Список шаблонов</h1>
                    <img src={this.props.image} alt="arrow" id = "butImg"></img>
                </button>
            </div>
        )
    }
    gotocreate () {
        console.log("Create");
    }
    gotoselect () {
        console.log("Select");
    }
}

export default MainButtoms
